import React, { Component } from "react";
import { connect } from "react-redux";
import Shop_Collecion from "./Shop_Collection";
import CollectionPreview from "../../components/collectionPreview/collectionPreview.com";

class ShopPage extends Component {
  state = { collection: Shop_Collecion };
  render() {
    return (
      <div className="shop-collection">
        {this.state.collection.map(({ id, ...otherPropsCollection }) => (
          <CollectionPreview key={id} {...otherPropsCollection} />
        ))}
      </div>
    );
  }
}

export default connect()(ShopPage);
